import React from "react";
import axios from "axios";
import { useState, useEffect } from "react";
function Plan() {
  const [getplan, setPlan] = useState({});

  useEffect(() => {
    async function getAllPlan() {
      try {
        const plandata = await axios.get("http://127.0.0.1:8000/list/");

        console.log(plandata.data);
        setPlan(plandata.data);
      } catch (error) {
        console.log(error);
      }
    }
    getAllPlan();
  }, []);
  <h1>Connect with Django</h1>;
  return (
    <div>
      <h6>Item List Data from Django</h6>
      {getplan.map((items, i) => (
        <div>
          <h1>{items.id}</h1>
          <h2>{items.item}</h2>
        </div>
      ))}
    </div>
  );
}

export default Plan;
